import{_ as e,c as a,o as r,U as t}from"./chunks/framework.Zo-JgKpV.js";const _=JSON.parse('{"title":"ExposerJS x Prisma","description":"","frontmatter":{},"headers":[],"relativePath":"extensions/orm-prisma.md","filePath":"extensions/orm-prisma.md"}'),o={name:"extensions/orm-prisma.md"},s=t('<h1 id="exposerjs-x-prisma" tabindex="-1">ExposerJS x Prisma <a class="header-anchor" href="#exposerjs-x-prisma" aria-label="Permalink to &quot;ExposerJS x Prisma&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">ExposerJS ORM Supports</p><p>In order to be able to support other ORMs in the future. Therefore we separate the code related to any orm in this library. But to facilitate the user experience we add Prisma by default</p></div><h2 id="why-prisma" tabindex="-1">Why Prisma? <a class="header-anchor" href="#why-prisma" aria-label="Permalink to &quot;Why Prisma?&quot;">​</a></h2><p>We were looking for an orm with great support and that was one of the most used. It is the most used orm of the big 3 to date (2023/11/XX) of download visualization in npm:</p><ul><li>Prisma ± 1.800.000 Weekly Downloads</li><li>TypeORM ± 1.500.000 Weekly Downloads</li><li>Sequelize ± 1.500.000 Weekly Downloads</li></ul><p>We tried it and we liked it and that is why we included it by default in core of ExposerJS.</p><h2 id="links" tabindex="-1">Links <a class="header-anchor" href="#links" aria-label="Permalink to &quot;Links&quot;">​</a></h2><ul><li><a href="https://github.com/alexmorenograu/exposerjs-orm-prisma" target="_blank" rel="noreferrer">GitHub ExposerJS-ORM-Prisma</a></li><li><a href="https://www.npmjs.com/package/exposerjs-orm-prisma" target="_blank" rel="noreferrer">NPM ExposerJS-ORM-Prisma</a></li></ul>',8),i=[s];function l(n,p,m,d,h,c){return r(),a("div",null,i)}const x=e(o,[["render",l]]);export{_ as __pageData,x as default};
